import React from 'react';
import './buttons.css';
import {Link} from 'react-router-dom'

function Nave() {
  return (
            <>
                <Link to='/' className='button'>Home</Link>
                <Link to='/about' className='button'>About</Link>
            </>
  );
};

export default Nave;
